import React from 'react';
import Feature from './Components/Feature';
import Header from './Components/Header';
import About from './Components/About';
import ABoutImage1 from './images/about.png';
import ABout_Download_Img from './images/download.png';

function App() {
  return (
    <div className="App">
      <Header />
      <Feature />
      <About image={ ABoutImage1 } title="Comes With All You Need For Daily Life" button_text="Get Tha App" />
      <About image={ ABout_Download_Img } title="Download And Get Tha App Now" button_text="Get Tha App" />
    </div>
  );
}

export default App;
